column8:
エクサス3は、ジータ3を基本スペックとして、車内スペースのタイトな車のために、左右ショルダーサポートをコンパクト化したモデルです。<br><br>●使用シートレール：FO・FB・FKタイプもしくはFGタイプ（各車両によりFO・FB・FKタイプ及びFGタイプいずれかの設定になります）・FXタイプ（FXタイプでもシートポジションは同等となります） ●日本製 ●保安基準適合モデル ●約6.6kg<br><br>※2名乗車以外の車両には背面にシートバックプロテクターが必要になります。 ※2ドアの4シーターの場合、左右同時にフルバケットを装着すると車検対応になりません。この場合2名乗車に乗車定員の変更申請が必要です。<br><br>汎用品<br><br><br><br>インテリア | シート<tr><td colspan="2">
